import React from "react";
import Link from "next/link";
import {
  Container,
  Text,
  SubHeader,
  Input,
  PrimaryButton,
  SubText,
  Header,
  ActionButton,
  CaptionText
} from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.3;
  padding-top: 50px;
  padding-left: 60px;
  padding-right: 10px;

  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;
const FormWrapper = styled(Container)`
  flex-direction: column;
  padding-top: 40px;
  padding-left: 60px;
  padding-right: 60px;
  flex: 0.7;
  min-height: 100%;
  max-height: 100%;
`;
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 50%;
  flex: 0.72;
  padding-top: 30px;
  /* background-color: red; */
`;

const CompleteRegister = () => {
  return (
    <Container
      flex={1}
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <FormWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text>House-Assist Space</Text>
        </Container>
        <Container flex={1} column center>
          <Form>
            <Header customStyles={{ fontWeight: "400", marginBottom: 5 }}>
              Last step: Select your password
            </Header>
            <Header customStyles={{ fontWeight: "400" }}>
              and verify your information
            </Header>
            <fieldset
              style={{
                display: "flex",
                paddingTop: "30px",
                paddingLeft: 0,
                paddingRight: 0,
                paddingBottom: 0,
                border: "none",
                flexDirection: "column",
                marginBottom: 10
              }}
            >
              <Input
                label="YOUR EMAIL"
                placeholder="eg: name@example.com"
                defaultValue="larenz39@yahoo.com"
                type="email"
              />
              <Input
                label="PASSWORD"
                type="password"
                defaultValue="Mygodjesus1"
              />
              <CaptionText customStyles={{ marginBottom: 10 }}>
                Tell us a little more about yourself
              </CaptionText>
              <Input label="FIRST NAME" placeholder="First Name" type="text" />
              <Input label="LAST NAME" placeholder="Last Name" type="text" />
              <Input
                label="PHONE NUMBER"
                placeholder="Phone Number"
                type="tel"
              />
            </fieldset>

            <PrimaryButton type="submit" customStyles={{ padding: 12 }}>
              Create your account
            </PrimaryButton>
            <Container row middle center customStyles={{ marginTop: 40 }}>
              <SubText
                customStyles={{
                  fontWeight: "italic"
                }}
              >
                Already have an account?
              </SubText>
              <Link href={"/Landlrd/login"} as={"/landlord/login"}>
                <a>
                  <SubText
                    customStyles={{
                      fontWeight: "italic",
                      color: "#0078D4",
                      marginLeft: 8
                    }}
                  >
                    Log in here.
                  </SubText>
                </a>
              </Link>
            </Container>
          </Form>
        </Container>
      </FormWrapper>
      <ImgWrapper />
    </Container>
  );
};

export default CompleteRegister;
